import React from "react";

interface AppLayout {
    children: HTMLElement;
}

class AppLayout extends React.Component <{}> {

    constructor(children:HTMLElement){
        super(children);

    }
    render(){
        return(
            <div>
                <div>Common Menu</div>
                {this.children}
            </div>
        )
    }
}


export default AppLayout;
